import { useState } from "react";
import axios from "axios";
import { FaSearch, FaMapMarkerAlt, FaTools } from "react-icons/fa";

function Search() {
  const [skill, setSkill] = useState("");
  const [type, setType] = useState("");
  const [location, setLocation] = useState("");
  const [results, setResults] = useState([]);
  const [searched, setSearched] = useState(false);

  const handleSearch = async () => {
    try {
      const token = localStorage.getItem("token");
      const res = await axios.get("http://localhost:5000/api/search", {
        params: { skill, type, location },
        headers: { Authorization: `Bearer ${token}` },
      });
      setResults(res.data);
      setSearched(true);
    } catch (err) {
      console.error("Error buscando:", err);
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-6 bg-gray-50 rounded-xl shadow-lg">
      <h2 className="text-3xl font-bold mb-6 text-blue-700 text-center">üîç Buscar Habilidades</h2>

      {/* Filtros */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-6">
        <div className="relative">
          <FaTools className="absolute top-3 left-3 text-gray-400" />
          <input
            type="text"
            placeholder="Habilidad (ej. guitarra)"
            value={skill}
            onChange={(e) => setSkill(e.target.value)}
            className="pl-10 border rounded-lg p-2 w-full focus:outline-none focus:ring-2 focus:ring-blue-400"
          />
        </div>

        <select
          value={type}
          onChange={(e) => setType(e.target.value)}
          className="border rounded-lg p-2 w-full focus:outline-none focus:ring-2 focus:ring-blue-400"
        >
          <option value="">Todos</option>
          <option value="offer">Ofertadas</option>
          <option value="want">Buscadas</option>
        </select>

        <div className="relative">
          <FaMapMarkerAlt className="absolute top-3 left-3 text-gray-400" />
          <input
            type="text"
            placeholder="Ubicaci√≥n"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            className="pl-10 border rounded-lg p-2 w-full focus:outline-none focus:ring-2 focus:ring-blue-400"
          />
        </div>
      </div>

      <button
        onClick={handleSearch}
        className="bg-blue-600 text-white px-6 py-2 rounded-lg hover:bg-blue-700 transition duration-300 w-full md:w-auto items-center"
      >
        Buscar
      </button>

      {/* Resultados */}
      <div className="mt-8 space-y-4">
        {searched && results.length === 0 ? (
          <div className="text-center text-gray-500">
            <p>No se encontraron coincidencias con tu b√∫squeda.</p>
          </div>
        ) : (
          results.map((r, idx) => (
            <div
              key={idx}
              className="p-4 bg-white shadow-md rounded-lg border flex items-center gap-4 hover:shadow-lg transition"
            >
              {r.avatar_url ? (
                <img
                  src={r.avatar_url}
                  alt={r.name}
                  className="w-14 h-14 rounded-full object-cover"
                />
              ) : (
                <div className="w-14 h-14 rounded-full bg-blue-500 flex items-center justify-center text-white font-bold text-xl">
                  {r.name ? r.name.charAt(0).toUpperCase() : "?"}
                </div>
              )}

              <div>
                <h3 className="font-semibold text-lg">{r.name}</h3>
                <p className="text-sm text-gray-600">{r.location}</p>
                <p className="text-blue-600 text-sm">
                  {r.type === "offer" ? "Ofrece: " : "Busca: "} {r.skill_name}
                </p>
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
}

export default Search;
